function hideLoginBtn() {
  var loginBtn = document.querySelector('.login-btn');
  var makeVisitBtn = document.querySelector('.visit-btn');

  if (localStorage.password && localStorage.email) {
    loginBtn.classList.remove('show');
    loginBtn.classList.add('hide');
    makeVisitBtn.classList.remove('hide');
    makeVisitBtn.classList.add('show');
  } else {
    loginBtn.classList.remove('hide');
    loginBtn.classList.add('show');
    makeVisitBtn.classList.remove('show');
    makeVisitBtn.classList.add('hide');
  }
}

